const TUTORIAL_UPDATE_DATE = '2026-02-21';
const TUTORIAL_VERSION = 'v1';

const CHAR_SMILING = 'data:image/png;base64,';
const CHAR_BALL    = 'data:image/png;base64,';

(function() {
  'use strict';

  async function shouldShowTutorial() {
    if (!isLoggedIn || !isLoggedIn()) return false;
    const uid = getUserId ? getUserId() : null;
    if (!uid) return false;
    try {
      const snap = await db.ref(`users/${uid}/tutorial/categoryMark`).once('value');
      const data = snap.val();
      if (data && data.completed) return false;
      if (data && data.categoryClickedAt) {
        return data.categoryClickedAt < new Date(TUTORIAL_UPDATE_DATE).getTime();
      }
      return true;
    } catch(e) { return false; }
  }

  async function markTutorialComplete(type) {
    const uid = getUserId ? getUserId() : null;
    if (!uid) return;
    const update = { version: TUTORIAL_VERSION };
    if (type === 'clicked') update.categoryClickedAt = Date.now();
    else { update.completed = true; update.completedAt = Date.now(); }
    await db.ref(`users/${uid}/tutorial/categoryMark`).update(update);
  }

  function injectStyles() {
    if (document.getElementById('ct-styles')) return;
    const style = document.createElement('style');
    style.id = 'ct-styles';
    style.textContent = `
      @import url('https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@400;700;900&display=swap');
      #ct-overlay {
        position:fixed; inset:0; background:rgba(0,0,0,0.78);
        backdrop-filter:blur(5px); z-index:99998;
        display:flex; align-items:flex-end; justify-content:center;
        animation:ct-fadein 0.4s ease;
      }
      @keyframes ct-fadein { from{opacity:0} to{opacity:1} }
      #ct-card {
        background:linear-gradient(160deg,#1a0a00,#2d1200 60%,#1a0a00);
        border:1.5px solid #ff6b1a55; border-bottom:none;
        border-radius:28px 28px 0 0; padding:0 24px 44px;
        width:100%; max-width:460px; position:relative; overflow:visible;
        animation:ct-slideup 0.45s cubic-bezier(.22,.68,0,1.2);
        font-family:'Noto Sans KR',sans-serif;
        box-shadow:0 -8px 40px rgba(255,100,0,0.3);
      }
      @keyframes ct-slideup { from{transform:translateY(100%)} to{transform:translateY(0)} }
      #ct-card::before {
        content:''; display:block; height:3px; margin:0 -24px;
        background:linear-gradient(90deg,transparent,#ff6b1a,#ffcc00,#ff6b1a,transparent);
        background-size:200% 100%; animation:ct-shimmer 2s linear infinite;
      }
      @keyframes ct-shimmer { 0%{background-position:200% 0} 100%{background-position:-200% 0} }
      #ct-char {
        position:absolute; top:-85px; right:20px;
        width:100px; height:100px; border-radius:50%; overflow:hidden;
        animation:ct-float 3s ease-in-out infinite;
        filter:drop-shadow(0 0 18px rgba(255,120,0,0.9));
        border:2.5px solid #ff6b1a77; background:#1a0a00;
        transition: all 0.4s ease;
      }
      #ct-char img { width:100%; height:100%; object-fit:cover; }
      @keyframes ct-float {
        0%,100%{transform:translateY(0) rotate(-3deg)}
        50%{transform:translateY(-12px) rotate(3deg)}
      }
      #ct-steps { display:flex; gap:8px; margin:28px 0 16px; }
      .ct-dot {
        height:4px; border-radius:2px; background:#3a2010; flex:1;
        transition:background 0.4s, flex 0.4s;
      }
      .ct-dot.active { background:linear-gradient(90deg,#ff6b1a,#ffcc00); flex:2; }
      .ct-dot.done { background:#ff6b1a55; }
      #ct-title { font-size:20px; font-weight:900; color:#fff; line-height:1.4; margin-bottom:10px; }
      #ct-title em { color:#ffcc00; font-style:normal; }
      #ct-desc { font-size:14px; color:#c8a880; line-height:1.75; margin-bottom:18px; }
      #ct-hint {
        background:linear-gradient(135deg,#2d1600,#3d1f00);
        border:1px solid #ff6b1a44; border-radius:14px;
        padding:14px 16px; display:flex; align-items:center; gap:12px;
        margin-bottom:20px; animation:ct-pulse 2s ease-in-out infinite;
      }
      @keyframes ct-pulse {
        0%,100%{border-color:#ff6b1a33} 50%{border-color:#ff6b1a99}
      }
      #ct-hint-icon { font-size:26px; animation:ct-bounce 1s ease-in-out infinite; }
      @keyframes ct-bounce { 0%,100%{transform:translateY(0)} 50%{transform:translateY(-6px)} }
      #ct-hint-text { font-size:13px; color:#ffcc88; line-height:1.5; font-weight:700; }
      #ct-btn-row { display:flex; gap:10px; }
      #ct-skip {
        flex:0 0 auto; padding:0 18px; height:50px; border-radius:12px;
        border:1px solid #3a2010; background:transparent; color:#7a5030;
        font-size:13px; cursor:pointer; font-family:inherit; transition:all 0.2s;
      }
      #ct-skip:hover { color:#c87040; border-color:#c87040; }
      #ct-next {
        flex:1; height:50px; border-radius:12px; border:none;
        background:linear-gradient(135deg,#ff6b1a,#ffaa00);
        color:#1a0a00; font-size:15px; font-weight:900;
        cursor:pointer; font-family:inherit; transition:all 0.2s;
        box-shadow:0 4px 20px rgba(255,100,0,0.4);
      }
      #ct-next:hover { transform:translateY(-2px); box-shadow:0 6px 28px rgba(255,100,0,0.6); }
      #ct-next:active { transform:translateY(0); }
      .ct-ring {
        position:fixed; border:3px solid #ffcc00; border-radius:12px; pointer-events:none;
        z-index:99999; animation:ct-ring-pulse 1.2s ease-in-out infinite;
        box-shadow:0 0 0 5px rgba(255,204,0,0.15), 0 0 24px rgba(255,204,0,0.5);
      }
      @keyframes ct-ring-pulse {
        0%,100%{box-shadow:0 0 0 5px rgba(255,204,0,0.15),0 0 24px rgba(255,204,0,0.5)}
        50%{box-shadow:0 0 0 9px rgba(255,204,0,0.05),0 0 36px rgba(255,204,0,0.7)}
      }
    `;
    document.head.appendChild(style);
  }

  const STEPS = [
    {
      char: CHAR_SMILING,
      title: '<em>ÎßàÌÅ¨ ÌÉ≠</em>Ïù¥ ÏÉùÍ≤ºÏñ¥Ïöî! üîñ',
      desc: 'Ïπ¥ÌÖåÍ≥†Î¶¨ ÌÉ≠Ïóê ÏÉàÎ°úÏö¥ <em style="color:#ffcc00">ÎßàÌÅ¨ ÌÉ≠</em>Ïù¥ Ï∂îÍ∞ÄÎêêÏñ¥Ïöî!\nÎ∂ÅÎßàÌÅ¨Ìïú Í∏∞ÏÇ¨Î•º ÌïúÎààÏóê Î™®ÏïÑÎ≥º Ïàò ÏûàÎãµÎãàÎã§.',
      hint: '‚¨ÜÔ∏è',
      hintText: 'ÏÉÅÎã®Ïùò <b>Ïπ¥ÌÖåÍ≥†Î¶¨</b> Î≤ÑÌäºÏùÑ ÎàåÎü¨Î≥¥ÏÑ∏Ïöî!',
      nextLabel: 'Ïπ¥ÌÖåÍ≥†Î¶¨ Î≥¥Îü¨ Í∞ÄÍ∏∞ ‚Üí',
      action: 'goto-category',
      selector: '[onclick*="showCategories"], [onclick*="category"], .nav-category, [data-tab="categories"]'
    },
    {
      char: CHAR_BALL,
      title: '<em>ÎßàÌÅ¨ ÌÉ≠</em>ÏùÑ ÎàåÎü¨Î≥¥ÏÑ∏Ïöî! üëÜ',
      desc: 'Ïπ¥ÌÖåÍ≥†Î¶¨ ÌÉ≠ ÏïàÏóêÏÑú <em style="color:#ffcc00">üîñ ÎßàÌÅ¨</em> ÌÉ≠ÏùÑ Ï∞æÏïÑ ÎàåÎü¨Î≥¥ÏÑ∏Ïöî!\nÎÇ¥Í∞Ä Î∂ÅÎßàÌÅ¨Ìïú Í∏∞ÏÇ¨Í∞Ä Ïó¨Í∏∞ Î™®Ïó¨ÏûàÏñ¥Ïöî.',
      hint: 'üëá',
      hintText: 'Ïπ¥ÌÖåÍ≥†Î¶¨ ÏïàÏóêÏÑú <b>ÎßàÌÅ¨ ÌÉ≠</b>ÏùÑ ÎàåÎü¨Î≥¥ÏÑ∏Ïöî!',
      nextLabel: 'ÏôÑÎ£å! ‚ú®',
      action: 'complete',
      selector: '[onclick*="mark"], [data-tab="mark"], .mark-tab, #markTab'
    }
  ];

  let currentStep = 0;
  let ring = null;

  function buildUI() {
    const overlay = document.createElement('div');
    overlay.id = 'ct-overlay';
    overlay.innerHTML = `
      <div id="ct-card">
        <div id="ct-char"><img id="ct-char-img" src="" alt="üî•"></div>
        <div id="ct-steps">
          ${STEPS.map((_,i) => `<div class="ct-dot ${i===0?'active':''}"></div>`).join('')}
        </div>
        <div id="ct-title"></div>
        <div id="ct-desc"></div>
        <div id="ct-hint">
          <div id="ct-hint-icon"></div>
          <div id="ct-hint-text"></div>
        </div>
        <div id="ct-btn-row">
          <button id="ct-skip">Í±¥ÎÑàÎõ∞Í∏∞</button>
          <button id="ct-next"></button>
        </div>
      </div>`;
    document.body.appendChild(overlay);
    document.getElementById('ct-skip').addEventListener('click', closeTutorial);
    document.getElementById('ct-next').addEventListener('click', handleNext);
    overlay.addEventListener('click', e => { if (e.target === overlay) closeTutorial(); });
    renderStep(0);
  }

  function renderStep(idx) {
    const s = STEPS[idx];
    // Ï∫êÎ¶≠ÌÑ∞ ÍµêÏ≤¥ (ÏÇ¥Ïßù Ïä§ÏºÄÏùº Ïï†ÎãàÎ©îÏù¥ÏÖò)
    const charEl = document.getElementById('ct-char');
    charEl.style.transform = 'scale(0.7)';
    setTimeout(() => {
      document.getElementById('ct-char-img').src = s.char;
      charEl.style.transition = 'transform 0.35s cubic-bezier(.22,.68,0,1.3)';
      charEl.style.transform = 'scale(1)';
    }, 150);

    document.getElementById('ct-title').innerHTML = s.title;
    document.getElementById('ct-desc').innerHTML = s.desc.replace(/\n/g, '<br>');
    document.getElementById('ct-hint-icon').textContent = s.hint;
    document.getElementById('ct-hint-text').innerHTML = s.hintText;
    document.getElementById('ct-next').textContent = s.nextLabel;
    document.querySelectorAll('.ct-dot').forEach((d,i) => {
      d.className = 'ct-dot' + (i<idx?' done':i===idx?' active':'');
    });
    removeRing();
    highlightElement(s.selector);
  }

  function handleNext() {
    const s = STEPS[currentStep];
    if (s.action === 'goto-category') {
      const el = findElement(s.selector);
      if (el) el.click();
      markTutorialComplete('clicked');
      currentStep = 1;
      renderStep(1);
    } else {
      markTutorialComplete('done');
      const card = document.getElementById('ct-card');
      card.style.animation = 'ct-slideup 0.3s ease reverse';
      setTimeout(closeTutorial, 280);
    }
  }

  function findElement(selector) {
    for (const s of selector.split(',')) {
      try { const el = document.querySelector(s.trim()); if (el) return el; } catch(e) {}
    }
    return null;
  }

  function highlightElement(selector) {
    const el = findElement(selector);
    if (!el) return;
    ring = document.createElement('div');
    ring.className = 'ct-ring';
    const r = el.getBoundingClientRect();
    Object.assign(ring.style, {
      top: (r.top-5)+'px', left: (r.left-5)+'px',
      width: (r.width+10)+'px', height: (r.height+10)+'px'
    });
    document.body.appendChild(ring);
  }

  function removeRing() { if (ring) { ring.remove(); ring = null; } }

  function closeTutorial() {
    removeRing();
    const overlay = document.getElementById('ct-overlay');
    if (overlay) {
      overlay.style.opacity = '0';
      overlay.style.transition = 'opacity 0.3s';
      setTimeout(() => overlay.remove(), 300);
    }
  }

  async function init() {
    await new Promise(resolve => {
      if (typeof auth !== 'undefined') auth.onAuthStateChanged(() => resolve());
      else setTimeout(resolve, 1000);
    });
    await new Promise(resolve => setTimeout(resolve, 1500));
    if (await shouldShowTutorial()) { injectStyles(); buildUI(); }
  }

  document.readyState === 'loading'
    ? document.addEventListener('DOMContentLoaded', init)
    : init();
})();